style.css:
/* Apply the background to the entire Discord interface */
body {
    background-image: url('https://66.media.tumblr.com/cca9f9db318f0400c91fd58f8e484e06/tumblr_inline_ooknqkgEHm1u3qj42_500.gif');
    background-size: cover;
    background-position: center;
    background-repeat: no-repeat;
}

/* Customize the appearance of the chat area */
div[class^="messagesWrapper-"] {
    background-color: rgba(0, 0, 0, 0.7); /* Adjust the alpha value for transparency */
}

/* Customize the appearance of the chat messages */
div[class^="message-"] {
    background-color: rgba(255, 255, 255, 0.1); /* Adjust the alpha value for transparency */
    border-radius: 10px;
    padding: 5px;
    margin: 5px;
}

/* Customize the appearance of the channel list */
div[class^="channels-"] {
    background-color: rgba(0, 0, 0, 0.7); /* Adjust the alpha value for transparency */
}

/* Customize the appearance of the user list */
div[class^="members-"] {
    background-color: rgba(0, 0, 0, 0.7); /* Adjust the alpha value for transparency */
}

/* Customize the appearance of the server list */
div[class^="guilds-"] {
    background-color: rgba(0, 0, 0, 0.7); /* Adjust the alpha value for transparency */
}

/* Customize the appearance of the input area */
div[class^="container-"] {
    background-color: rgba(0, 0, 0, 0.7); /* Adjust the alpha value for transparency */
}

/* Customize the appearance of the mention pop-up */
div[class^="popout-"] {
    background-color: rgba(255, 255, 255, 0.1); /* Adjust the alpha value for transparency */
    border-radius: 10px;
    padding: 5px;
}
